import React from 'react';
// 1. Import Routes and Route
import { Routes, Route } from 'react-router-dom';

// 2. Import all your page components
import Header from './templates/header'; 
import LoginPage from './templates/login'; // Assuming you have this
import StartTask from './templates/StartTask'; // Your main task page
import SubmittedTasks from './templates/SubmittedTasks'; // Your submitted tasks page

function App() {
  return (
    <div className="page-container">
      {/* 3. The Header is outside <Routes>, so it stays on every page */}
      <Header />

      {/* 4. <Routes> defines which component to show for which URL */}
      <Routes>
        {/* The "index" route (path="/") will be your login page */}
        <Route index path="/" element={<LoginPage />} />

        {/* Your other pages */}
        <Route path="/start-task" element={<StartTask />} />
        <Route path="/submitted-tasks" element={<SubmittedTasks />} />

        {/* You can add more routes here, e.g., for Notifications */}
        {/* <Route path="/notifications" element={<NotificationsPage />} /> */}
      </Routes>
    </div>
  );
}

export default App;
